    <div>
      <input
        placeholder="First Name"
        onChange={(event) => {
          setUser((user) => ({ ...user, firstName: event.target.value }));
        }}
      />
      <input placeholder="Last Name" />
      <input placeholder="Username" />
      <input placeholder="Password" type="password" />
      <button> Login</button>
    </div>
  );
}

export default Login;
